The Two-Income Trap: Why Middle-Class Mothers and Fathers Are Going Broke -- by Elizabeth Warren, Amelia Warren Tyagi, PDF format, 4.7 MB

Why two incomes may not be better than one! Stay single, you guys! :-)

Amazon.com :-

Warren, a law professor at Harvard (The Fragile Middle Class) and her daughter Tyagi, a former McKinsey consultant, have joined forces here to argue here that the two-parent middle-class working family is on the brink of financial disaster.
